import React, {FC} from "react"
import {MenuItem, Select} from "@material-ui/core"


export const CustomFormikSelector = ({setFieldValue, value, ...props}) => {

    const handleOnchange = ({target}) => {
        setFieldValue(props.name, target.value)
    }

    return (
        <Select
            defaultValue='Выберите тип объявления'
            value={value}
            onChange={handleOnchange}
            // className={classes.selectPrice}
        >
            {props.children}
        </Select>
    )
};
